import { createGlobalStyle } from 'styled-components';

import pixelartwoff from './pixelart.woff';

export default createGlobalStyle`
    @font-face {
        font-family: 'Pixel-Art Regular';
        src: local('./pixelart'),
        url(${pixelartwoff}) format('woff');
        font-weight: 300;
        font-style: normal;
    }
`;
